CREATE OR REPLACE FUNCTION luas_lingkaran(int,int,int)
  RETURNS DOUBLE PRECISION AS
$$
DECLARE
  luas DOUBLE PRECISION;
BEGIN
  luas = 0.5 * $1 * $2 ;
  RETURN luas;
END;
$$
LANGUAGE plpgsql;

