Pakai trik berikut ini

`DROP TABLE IF EXISTS buffer;
CREATE TEMP TABLE buffer AS
SELECT * FROM nama_tabel;
ALTER TABLE buffer
DROP COLUMN umur;
SELECT * FROM buffer;`

berarti ini bukan replica.

coba jalanin: select pg_is_in_recovery();

kalau output-nya "f" berarti dia sudah jadi master sendiri, alias bukan lagi replica

Error sudah jelas bahwa query di dalam SP itu tidak punya tujuan.
Coba pakai trik ini
Drop table if exists buffer;
Create temp table buffer as {query};
